import React, { useState } from 'react';
import { Button } from 'react-bootstrap';
import { useHistory } from 'react-router-dom';
import Modal from 'react-modal';


function iCashModal() {
	const [iCashModalIsOpen,setiCashModalIsOpen] = useState(false)
	return (
		<div className="SaveMe">
			<Button className="SaveMeBtn" onClick={() => setiCashModalIsOpen(true)}></Button>

			<div className="saveMeWrapper">
				<Modal className="modalFrame" isOpen={iCashModalIsOpen} onRequestClose={() => setiCashModalIsOpen(false)}>
					<div className="Clooosebtn">
						<Button className="closeBtn" onClick={() => setiCashModalIsOpen(false)}>
							X
						</Button>
					</div>
					<h1 className="saveMeTitleMod">
						iCash
					</h1>

					<div className="etextsaveMeWrap">
						<p className="saveMeEText">
							We just alert EVERYONE
							<br />
							in our power please keep <br />
							safe sister, we are in our way there!
						</p>
					</div>
				</Modal>
			</div>
		</div>
	);
}

export default iCashModal;
